import React from "react";
import { Card } from "../Card";

type Flight = {
    ident: string,
    departuretime: number,
    arrivaltime: number,
    readableDeparture: string,
    readableArrival: string,
    origin: string,
    destination: string,
} 


type Props = {
    flight: Flight,
    onDragStart,
} 

const FlightCard = ({ flight, onDragStart} : Props) => {
    const { ident,
            departuretime,
            arrivaltime,
            readableDeparture,
            readableArrival,
            origin,
            destination } = flight;

    return (<Card draggable={true}>
        <p>{ident}</p>
        <p>{departuretime}</p>
        <p>{arrivaltime}</p>
        <p>{readableDeparture}</p>
        <p>{readableArrival}</p>
        <p>{origin}</p>
        <p>{destination}</p>
    </Card>);
};

export default FlightCard;
